import {CREATE_DATA} from "../types"

const initialState ={
                        uid: '',
                        name: "",
                        comment: "",
                        classViewProperty: "",
                        dbTable: ""
                    };

const WindowCreateNewData = (state = initialState, action) => {
    
    switch (action.type){
            
        case CREATE_DATA:
            console.log( ' reducer WindowCreateNewData ', action.payload);
            return action.payload;
            
        default: 
            return state;
    }
}
export default WindowCreateNewData
